import {
  faLocation,
  faLocationPin,
  faMapLocation,
} from "@fortawesome/free-solid-svg-icons";
function SearchBar() {
  return (
    <div className="searchbar">
      <div>
        <div>
          <FontAwesomeIcon icon={faLocationPin}></FontAwesomeIcon> Điểm đi{" "}
        </div>
        <div>
          <input type="text" value={"Nơi xuất phát"}></input>
        </div>
      </div>

      <label>Điểm đến</label>
      <input type="text" value={"Nơi đến"}></input>
      <label>Ngày đi</label>
      <input type="date" value={"nơi xuất phát"}></input>
    </div>
  );
}

export default SearchBar;
